description:
I found this interesting non-native shrub along the Stevens Creek Trail in Mountain View, CA.  I've tentatively identified it as a Silverleaf Cotoneaster (Cotoneaster pannosus), based on:

(1) Its dense corymbs of small, white, five-petaled flowers with many spirally-arranged stamens,
(2) its elliptical leaves with simple margins and tomentose hairs on their lower surfaces (but little to no hair on their upper surfaces); 
(3) the alternate arrangement of the leaves;
(4) the tomentose hairs on the young growth of twigs;
(5) the shrub's resemblance to pyracantha (but lacking the pyracantha's thorns).

I am by no means a cotoneaster expert, however, so I'm open to suggestions as to what this shrub might be.

Shot 1 shows has a good shot of the open flowers, in varying states of maturity. You can also see the tomentose undersurface of the leaves if you look at the young leaves to the upper left of the flowers.  Shot 2 focuses primarily on the leaves, their alernate arrangement, and the tomontose hairs of the undersurface forming a fuzzy fringe to each leaf.
